    value: "This report was amended because $37.00 inadvertently was moved to line
      17. It was actually a individual unitemized contribution. Schedule B line 21b
      for individuals that are paid 100% federal but not currently involved in federal
      election activity.  Schedule H4 line 21a for individuals who spend more the
      0% but less than 25% in a given month on any federal activity.  Schedule B line
      30b for individuals who spend any time on Federal  Election Activity.  All expenses
      related to the individuals are split amongst these three groups.  Lockridge,
      Grindal, Nauen, LLP reviewed the bills sent to the party.  They went back to
      January of 2012 and broke the bills into three categories.  Party Legal Advice,
      Campaign Legal Advice, Other Advice (city elections, recounts).  It was determined
      that the amount the Party has been reporting as a debt was in fact charges for
      opinions requested by either the State House or State Senate Caucuses.  They
      will be responsible for the amount of $18,361.85.  The State Party was required
      to pay up front with cashier?s checks for the election night party.  One check
      was a deposit of $15,000.00 and the other for cost $25,269.94. This committee
      discloses payments for payroll, taxes and health-dental-life insurance on became
      necessary for us to draw on our state account as this is the only account with
      a verified balance large enough to cover the cashiers check.  Our bank accounts
      were not able to be verified because the company that does the processing work
      for our bank (Drake Bank) was located in New Jersey and shut down because of
      Hurricane Sandy.  The processing center was unable to provide any information
      for several days and when they were up and functioning they had to re-process
      all the transactions that had been lost from their initial shut down.  The party
      waited as long as possible for correct balances to appear in our bank accounts.
      \ Unfortunately it was not done by the time we had to pay for the Election Night
      party.  The deposit for $15,000.00 has not been processed by the hotel and no
      funds have been returned to the party.  If any of the $15,000.00 is not returned
      because we failed to meet guarantees, that amount will also appear as a transfer
      on our FEC report.  The October bank statements were finally delivered in the
      mail on November 27th.  The party paid for all volunteer materials on this report
      with its own funds.  No funds from National Party Transfers were used in association
      with these activities.  \n"
